contract SqueezePool is ERC20,WhitelistAdminRole {

  address internal constant UNISWAP_ROUTER_ADDRESS = 0x7a250d5630B4cF539739dF2C5dAcb4c659F2488D;
  using SafeERC20 for IERC20;
  using Address for address;
  using SafeMath for uint256;
  IUniswapV2Router02 public uniswapRouter;
  ERC20 constant internal CRT_TOKEN = ERC20(0xBa0EF82a023De4223fd44B97f497bA2a89f28aC3);
  address private CRTAddress = 0xBa0EF82a023De4223fd44B97f497bA2a89f28aC3;
  struct stakeTracker {
        uint256 lastBlockChecked;
        uint256 rewards;
        uint256 ETHStaked;
    }
  address private owner;
  address private fundAddress;
  uint256 private liquidityMultiplier;
  using SafeMath for uint256;
  address private ETHAddress;
  IERC20 private ETHToken;
  uint256 private _totalETHStaked;
  uint256 private rewardsVar = 500000;
  uint256 public targetETH;
  bool public poolIsOpen = false;
  uint256 public StartingTimestamp;
  IERC20 private CRT;

  event ETHStaked(address indexed user, uint256 amount, uint256 totalETHStaked);
  event ETHWithdrawn(address indexed user, uint256 amount);
  event Rewards(address indexed user, uint256 reward);

    modifier updateStakingReward(address account) {
        _stakedBalances[account].rewards = myRewardsBalance(msg.sender);
        _stakedBalances[account].lastBlockChecked = block.number;        
        _;
    }

    modifier claimRewards() {
        uint256 reward = _stakedBalances[msg.sender].rewards;
        _stakedBalances[msg.sender].rewards = 0;
        CRT.transferFrom(address(this), msg.sender, reward);
        emit Rewards(msg.sender, reward);
        _;
    }

  mapping(address => stakeTracker) private _stakedBalances;

  constructor() public ERC20("SqueezeETH", "SqETH") {
        _mint(msg.sender, 0 * (10 ** 18));
        owner = msg.sender;
        uniswapRouter = IUniswapV2Router02(UNISWAP_ROUTER_ADDRESS);
    }

  function convertEthToCRT(uint crtAmount) public payable {
    require(!poolIsOpen);
    uint deadline = block.timestamp + 45;
    uniswapRouter.swapETHForExactTokens{ value: msg.value }(crtAmount, getPathForETHtoCRT(), address(this), deadline);

    // refund leftover ETH to user
    (bool success,) = msg.sender.call{ value: address(this).balance }("");
    require(success, "refund failed");
  }

  function getEstimatedETHforCRT(uint crtAmount) public view returns (uint[] memory) {
    return uniswapRouter.getAmountsIn(crtAmount, getPathForETHtoCRT());
  }

  function getPathForETHtoCRT() private view returns (address[] memory) {
    address[] memory path = new address[](2);
    path[0] = uniswapRouter.WETH();
    path[1] = CRTAddress;

    return path;
  }

   function setSqueezePoolSettings(uint256 _targetETH) public onlyWhitelistAdmin {
        require(!poolIsOpen);
        StartingTimestamp = block.timestamp + 150;
        targetETH = _targetETH;
        _totalSupply = 0;
        poolIsOpen = true;
    }

    function burnAllTokens() public onlyWhitelistAdmin {
        _totalSupply = 0;
    }

    function closePool() public {
        require(totalSupply() >= targetETH);
        poolIsOpen = false;
    }

    function openPool() public onlyWhitelistAdmin {
        require(totalSupply() < 1);
        poolIsOpen = true;
    }

    function setRewardsVar(uint256 _rewardsVar) public onlyWhitelistAdmin {
        rewardsVar = _rewardsVar;
    }

    function mintSqETH() public payable updateStakingReward(msg.sender) {
        require(StartingTimestamp < block.timestamp);
        require(poolIsOpen);
        _totalETHStaked = _totalETHStaked.add(msg.value);
        _stakedBalances[msg.sender].ETHStaked = _stakedBalances[msg.sender].ETHStaked.add(msg.value);
        _mint(msg.sender, msg.value);
        emit ETHStaked(msg.sender, msg.value, _totalETHStaked);
    }

    function myRewardsBalance(address account) public view returns (uint256) {
        if (block.number > _stakedBalances[account].lastBlockChecked) {
            uint256 rewardBlocks = block.number
            .sub(_stakedBalances[account].lastBlockChecked);

            if (_stakedBalances[account].ETHStaked > 0) {
                return _stakedBalances[account].rewards
                .add(
                    _stakedBalances[account].ETHStaked
                    .mul(rewardBlocks)
                    / rewardsVar);
            }
        }
    }


    function viewRatio(uint256 amount) public view returns (uint256) {
        uint256 ratio = amount.mul(10000).div(_totalSupply);
        return ratio;
    }

    function withdrawCRT(uint256 amount) public updateStakingReward(msg.sender) claimRewards() {
        require(!poolIsOpen);
        uint256 ratio = amount.mul(10000).div(_totalSupply);
        uint256 CRTPool = ERC20(CRT_TOKEN).balanceOf(address(this));
        _totalETHStaked = _totalETHStaked.sub(amount);
        _stakedBalances[msg.sender].ETHStaked = _stakedBalances[msg.sender].ETHStaked.sub(amount);
        uint256 payout = ratio.mul(CRTPool).div(10000);
        _burn(msg.sender, amount);
        ERC20(CRT_TOKEN).transferFrom(address(this), msg.sender, payout);
        emit ETHWithdrawn(msg.sender, payout);
    }

    function withdrawETH(uint256 amount) public updateStakingReward(msg.sender) claimRewards() {
        require(totalSupply() < targetETH);
        uint256 ratio = amount.mul(10000).div(_totalSupply);
        _totalETHStaked = _totalETHStaked.sub(amount);
        _stakedBalances[msg.sender].ETHStaked = _stakedBalances[msg.sender].ETHStaked.sub(amount);
        uint256 totalWithdrawable = address(this).balance;
        uint256 amountCalculate = ratio.mul(totalWithdrawable).div(10000);
        _burn(msg.sender, amount);
        msg.sender.transfer(amountCalculate);
        emit ETHWithdrawn(msg.sender, amountCalculate);
    }

   function getRewards(uint256 amount) public updateStakingReward(msg.sender) {
       uint256 reward = _stakedBalances[msg.sender].rewards;
       require(reward >= amount);
       _stakedBalances[msg.sender].rewards = reward.sub(amount);
       ERC20(CRT_TOKEN).transferFrom(address(this), msg.sender, amount);
       emit Rewards(msg.sender, reward);
   }

    function setCRTAddress(address _CRTAddress) public onlyWhitelistAdmin returns (uint256) {
        CRT = IERC20(_CRTAddress);
    }

    receive() payable external {}
}"
